// Login.js
import React, { useState } from 'react';
import './Login.css';
import axios from 'axios';



const Login = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin = async () => {
      const apiUrl = 'http://127.0.0.1:8000/register/';
      console.log('test')

      try {
          // Making a POST request to the simple API endpoint
          const response = await axios.post(apiUrl, {
              username: username,
              password: password,
          
          });
          console.log('Logging in:', response.data);
      } catch (error) {
          console.error('Error fetching simple API:', error.response ? error.response.data : error.message);
      }
  };
  
    return (
      <div className="login">
        <h1>Login Page</h1>
        <form>
          <label htmlFor="username">Username:</label>
          <input
            type="text"
            id="username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
          />
  
          <label htmlFor="password">Password:</label>
          <input
            type="password"
            id="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
  
          <button type="button" onClick={handleLogin}>
            Login
          </button>
        </form>
      </div>
    );
  };
  
  export default Login;
